  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer portrays the Congressional
  Districts of the United States for the 107th Congress. The map layer was created
  by extracting lines from existing National Atlas layers that were coincident with
  Congressional District boundaries. In areas lacking coincident geometry, lines from
  1:100,000-scale Congressional District boundaries published by the U.S. Department
  of Commerce, Bureau of the Census, Geography Division were generalized and integrated
  into the map layer. This is an update of the July 2001 map layer.\",\n\t\"license_title\":
